import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../producer.css'; // Arquivo CSS para estilização

const Producer = () => {
  const navigate = useNavigate();

  return (
    <div className="producer-container">
      {/* Header */}
      <header className="producer-header">
        <div className="logo" onClick={() => navigate('/')}>
          <h1>Divulgame</h1>
        </div>
        <nav className="producer-nav">
          <ul>
            <li onClick={() => navigate('/all-events')}>Meus Eventos</li>
            <li onClick={() => navigate('/support')}>Suporte</li>
            <li onClick={() => navigate('/logout')}>Sair</li>
          </ul>
        </nav>
      </header>

      {/* Main Content */}
      <div className="producer-main">
        <h2>Bem-vindo, Produtor!</h2>
        <p>Gerencie seus eventos e acompanhe seus resultados em tempo real.</p>

        <div className="producer-sections">
          {/* Criação de Evento */}
          <div className="section-card" onClick={() => navigate('/create-event')}>
            <h3>Criação de Evento</h3>
            <p>Crie, edite e publique eventos incríveis para seu público.</p>
          </div>

          {/* Configuração de Ingressos */}
          <div className="section-card" onClick={() => navigate('/ticket-settings')}>
            <h3>Configuração de Ingressos</h3>
            <p>Defina tipos de ingresso, preços e políticas de venda.</p>
          </div>

          {/* Painel de Controle Financeiro */}
          <div className="section-card" onClick={() => navigate('/financial-dashboard')}>
            <h3>Painel Financeiro</h3>
            <p>Acompanhe suas vendas, lucros e estatísticas.</p>
          </div>

          {/* Repasse de Valores */}
          <div className="section-card" onClick={() => navigate('/payouts')}>
            <h3>Repasse de Valores</h3>
            <p>Gerencie os repasses após o término dos eventos.</p>
          </div>

          {/* Suporte e Gestão de Segurança */}
          <div className="section-card" onClick={() => navigate('/support')}>
            <h3>Suporte e Segurança</h3>
            <p>Entre em contato com nosso suporte e gerencie a segurança dos eventos.</p>
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="producer-footer">
        <p>&copy; {new Date().getFullYear()} Divulgame. Todos os direitos reservados.</p>
      </footer>
    </div>
  );
};

export default Producer;
